$.isNW=function(n){return n===undefined||n===null||n.toString().trim().length===0};$.timeFormat=function(n,t){if(!$.isNW(n)){t=t||"MM/DD/YYYY hh:mm:ss A";var i=new moment.utc(n).tz("America/Los_Angeles");return i.format(t)}};$.dateFormat=function(n,t){if(!$.isNW(n)){t=t||"MM/DD/YYYY";var i=new moment.utc(n);return i.format(t)}};$.isSuccess=function(n){return n===""};$.getScrollTop=function(){var n=0,t=0;return document.body&&(n=document.body.scrollTop),document.documentElement&&(t=document.documentElement.scrollTop),n-t>0?n:t};$.getScrollHeight=function(){var n=0,t=0;return document.body&&(n=document.body.scrollHeight),document.documentElement&&(t=document.documentElement.scrollHeight),n-t>0?n:t};$.getWindowHeight=function(){return document.compatMode==="CSS1Compat"?document.documentElement.clientHeight:document.body.clientHeight};Vue.component("itembox",{props:["item"],template:'<div><div class="text-center"><img v-bind:src="item.imageUrl" class="card-img-top" alt="..."><\/div><div class="card-body"><h5 class="card-title">{{item.productName}}<\/h5><p class="card-text">{{item.itemNo}} (Stock: {{item.invQty}})<\/p><a href="#" class="btn btn-primary">Go somewhere<\/a><\/div><\/div>'});